import classes from "./MyPosts.module.css";
import Post from "./Posts/Post";

const MyPosts = () => {
  let postData = [
    {
      id: 1,
      message: "Hi, how are you?",
      likeCounts: 12,
    },
    {
      id: 2,
      message: "Its my first post",

    },
    {
      id: 3,
      message: "",
    },
    {
      id: 4,
      message: "",
    },
    {
      id: 5,
      message: "",
    },
  ];
  return (
    <div className={classes.postsBlock}>
      <h3>My posts</h3>
      <div>
        <div>
          <textarea></textarea>
        </div>
        <div>
          <button>Add post</button>
        </div>


      </div>
      <div className={classes.posts}>
        <Post massage={postData[0].message} likeCounts="15" />
        <Post massage={postData[1].message} likeCounts="20" />
      </div>
    </div>
  );
};

export default MyPosts;
